// Navbar.jsx
import React from 'react';
import '../styles/Navbar.css'; // Impor file CSS untuk Navbar
import logo from './assets/logo-pacmail.jpg'; // Gantilah dengan path yang sesuai

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <img src={logo} alt="PacMail Logo" className="logo" />
        <span className="brand">PacMail</span>
      </div>
      <ul className="navbar-right">
        <li>Inbox</li>
        <li>Sent</li>
      </ul>
    </nav>
  );
};

export default Navbar;
